Among my most-beloved #Rstats helpers

# like %in%, but greps for all the patterns (rhs) within the strings (lhs)

`%contain%` &lt;- function(strings,matchvec){
  Reduce(
     `|`,
     lapply(matchvec,function(m) {
        grepl(m,strings)
    })
   )
}

